def my_func(input1: str):
    if not (1 <= len(input1) <= 20):
        return None

    words = input1.split()
    result = []

    for word in words:
        parts = word.split('-')
        if len(parts) > 1:
            camel_case_word = parts[0] + ''.join(part.capitalize() for part in parts[1:])
            result.append(camel_case_word)
        else:
            result.append(word)

    return ' '.join(result)
